function DriverTrucks({ driverTrucks }) {
  console.log(driverTrucks)
  let unique = driverTrucks.filter((item, i, ar) => ar.indexOf(item) === i);
  console.log(unique)

  const trucksList = unique.map(truck => {

    return (
        <li key={truck.id}>
          <h3>Truck #{truck.id}</h3>
          <p> ‣ Model: {truck.truck_model}</p>
          <p> ‣ Color: {truck.truck_color}</p>
          <p> ‣ License Plate: {truck.license_plate}</p>
          <p> ‣ Mileage: {truck.mileage}</p>
          <p> ‣ Vin: {truck.vin_number}</p>  
        </li>  
    )
  })

  return (
    <div>
      <h2>Trucks:</h2>
      <ul>
        {trucksList}
      </ul>
    </div>
  )

}

export default DriverTrucks;
